import React from 'react';
import './SessionsPanel.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faAngleLeft } from '@fortawesome/free-solid-svg-icons';
import { faPlay } from '@fortawesome/free-solid-svg-icons';
import { faTrash } from '@fortawesome/free-solid-svg-icons';

class SessionsPanel extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <section id="SessionsPanel" className={this.props.visible ? 'visible' : null}>
                <section id="SessionsPanelButtons">
                    <FontAwesomeIcon icon={faAngleLeft} className="button" hideSessionsPanel={this.props.hideSessionsPanel} />
                </section>
                <section id="SessionsList">
                    <div className="Session"><FontAwesomeIcon icon={faPlay} className="icon" /> <FontAwesomeIcon icon={faTrash} className="icon danger" /> Session #1</div>
                    <div className="Session"><FontAwesomeIcon icon={faPlay} className="icon" /> <FontAwesomeIcon icon={faTrash} className="icon danger" /> Session #2</div>
                    <div className="Session"><FontAwesomeIcon icon={faPlay} className="icon" /> <FontAwesomeIcon icon={faTrash} className="icon danger" /> Session #3</div>
                </section>
            </section>
        );
    }
}

export default SessionsPanel;
